import {Button} from "@mui/material";
import {ButtonGroup} from "@mui/material";
import {TextField} from '@mui/material';
import { styled } from '@mui/material/styles';
import {Grid} from '@mui/material';
import {Paper} from '@mui/material';
import { useState } from "react";

import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';
import ImageIcon from '@mui/icons-material/Image';
import ListItemAvatar from '@mui/material/ListItemAvatar';



export default function SearchBox({ onSearch, onClose, isSearching, searchHistorial }) {
    const [searchText, setSearchText] = useState("");

    const Item = styled(Paper)(({ theme }) => ({
        ...theme.typography.body2,
        padding: theme.spacing(1),
        textAlign: 'center',
      }));

    const handleSearchClick = () => {
        setSearchText("");
        onClose();
    }

    return(            
        <div>
            <Grid item xs={12} md={12}>                
            </Grid>
            <Grid item xs={12} md={12}>
                <h2 className="search-box-titulo">Buscador de Ciudades</h2>
                
                    <label>
                        <TextField id="outlined-basic" label="Nombre de la ciudad" variant="outlined" 
                        value={searchText} 
                        onChange={({ target: { value }}) => setSearchText(value)}
                        className="search-box-input"
                        size="small"
                        />
                    </label>
            </Grid>
            <Grid item xs={12} md={12}>                   
                        <Button 
                            variant="contained" 
                            onClick={() => onSearch(searchText)} 
                            disabled={!searchText.length}
                            size="small"
                            style={{    
                                margin: "5px",                           
                                marginLeft: "5px",
                                marginRigth: "5px"
                            }}
                            >Buscar</Button>
                            {isSearching && 
                            <Button 
                                style={{ 
                                    margin: "5px",                              
                                    marginLeft: "5px",
                                    marginRigth: "5px"
                                }}
                                variant="contained" 
                                onClick={handleSearchClick} 
                                disabled={!searchText.length}
                                size="small"
                                color="error"
                            >Cerrar</Button>
                    }
                    {                    
                     searchHistorial.length > 0 && searchHistorial.map((values, index) => {
                         return( 
                            <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}> 
                            <ListItem>
                                <ListItemAvatar>
                                <Avatar>
                                    <ImageIcon />
                                </Avatar>
                                </ListItemAvatar>
                                <ListItemText primary={values.nombre_ciudad} secondary="Jan 9, 2014" />
                            </ListItem>                                                      
                            </List>                           
                         )
                     })
                    }         
            </Grid>        
        </div>   
    );
}
